import React, { Component } from 'react';

class Projects extends Component {
  render() {
    return (
<div className="Projects">
<div className="col-md-3">
    <div class="col-md-12">
         <div class="card">
             <div>
             <h4 style=""><b>Contributor</b></h4>
												<hr>	</hr>											
												<p>Architect & Engineer</p> 
             </div>
         </div>
    </div>
</div>
</div>
    );
  }
}

export default Projects;
